import React from "react";
const logo = ({ alt }) => {
	const logo = [ "/static/images/logo/logo.png", "/static/images/logo/logo-alt.png" ];
	return (
		<div>
			<img src="/static/images/logo/logo.png" className="image-responsive" alt="logo" />
		</div>
	);
};

export default logo;
